import React, { useEffect, useState } from "react";
import { useLocation } from "react-router-dom";
import axios from 'axios';
import './bootstrap.css';

export default function Studentsapply(){
    const location=useLocation();
    const user=location.state && location.state.user;
    const[data,setdata]=useState([]);
    useEffect(
        ()=>{getdata();},[]
    )
    const getdata=(event)=>{
        axios.get('http://localhost:9090/getstudents').then(response=>{
            setdata(response.data);
            console.log(response.data);
        })
    }
    return(
        <div>
            {user?(
                <div>
                    {alertmessage}
                    <table class="table table-hover">
                        <thead>
                        <tr>
                            <th scope="col">JobName</th>
                            <th scope="col">JobDesc</th>
                            <th scope="col">Student</th>
                            <th scope="col">Email</th>
                            <th scope="col">College</th>
                            <th scope="col">PhoneNo</th>
                            <th scope="col">Status</th>
                            <th scope="col">Options</th>
                        </tr>
                        </thead>
                        <tbody>
                        {data.map((job,key)=>{
                            if(job.status==="Accepted")
                            {
                                return(
                                    <tr class="table-success" key={key}>
                                        <td>{job.jobname}</td>
                                        <td>{job.jobdesc}</td>
                                        <td>{job.username}</td>
                                        <td>{job.email}</td>
                                        <td>{job.college}</td>
                                        <td>{job.phoneno}</td>
                                        <td>{job.status}</td>
                                    </tr>
                                )
                            }
                            else if(job.status==="Student Rejected")
                            {
                                return(
                                    <tr class="table-danger" key={key}>
                                        <td>{job.jobname}</td>
                                        <td>{job.jobdesc}</td>
                                        <td>{job.username}</td>
                                        <td>{job.email}</td>
                                        <td>{job.college}</td>
                                        <td>{job.phoneno}</td>
                                        <td>{job.status}</td>
            <td><button onClickCapture={()=>{axios.get("http://localhost:9090/rejected/"+job.jobdesc+"/"+job.username).then((response) => {
                setAlertMessage(
                    <div className="alert alert-dismissible alert-success">
                      <button type="button" className="btn-close" data-bs-dismiss="alert" onClickCapture={()=>{window.location.reload();}}></button>
                      <strong>Well done!</strong> {response.data}
                    </div>
                  );
            })}}>Remove</button></td>
                                    </tr>
                                )
                            }
                            else if(job.status!=="Rejected")
                            {
                            return(
                                <tr class="table-active" key={key}>
                                    <td>{job.jobname}</td>
                                    <td>{job.jobdesc}</td>
                                    <td>{job.username}</td>
                                    <td>{job.email}</td>
                                    <td>{job.college}</td>
                                    <td>{job.phoneno}</td>
                                    <td>{job.status}</td>
                                    <td><button onClickCapture={()=>{axios.get("http://localhost:9090/getresumedata/"+job.username, { responseType: 'arraybuffer' }).then((response) => {
      const filename = job.username + ' resume.jpeg';
      const blob = new Blob([response.data], { type: 'application/jpeg' });
      const url = window.URL.createObjectURL(blob);
      const link = document.createElement('a');
      link.href = url;
      link.download = filename;
      document.body.appendChild(link);
      link.click();
      document.body.removeChild(link);
      window.URL.revokeObjectURL(url);
        })}}>Download Resume</button>
        <button onClickCapture={()=>{axios.get("http://localhost:9090/rejected/"+job.jobdesc+"/"+job.username).then((response) => {
            setAlertMessage(
                <div className="alert alert-dismissible alert-success">
                  <button type="button" className="btn-close" data-bs-dismiss="alert" onClickCapture={()=>{window.location.reload();}}></button>
                  <strong>Well done!</strong> {response.data}
                </div>
              );
        })}}>Remove</button>
        <button onClickCapture={()=>{axios.get("http://localhost:9090/offer/"+job.jobdesc+"/"+job.username).then((response) => {
            setAlertMessage(
                <div className="alert alert-dismissible alert-success">
                  <button type="button" className="btn-close" data-bs-dismiss="alert" onClickCapture={()=>{window.location.reload();}}></button>
                  <strong>Well done!</strong> {response.data}
                </div>
              );
        })}}>Offer</button></td>
                                </tr>
                            )}
                        })}

                        </tbody>
                    </table>
                </div>
            ):(<div>Please Login to View Data</div>)
            }
        </div>
    );
}
